import React from "react";
import classes from './profile.module.css';
import myPosts from './myPosts/myPosts';


function Profile() {
   return (
      <div className={classes.content}>
        <div>
          <img className={classes.img} src="https://static.rcvostok.ru/images/brands/f91f5af39ce347afab47ccb7d8fadacf.png"></img>
        </div>
        <div className={classes.post}>
          <div>
            <img src="https://pbs.twimg.com/profile_images/1153463025061552128/2PIAbE_k_400x400.jpg" alt="" />
          </div>
          <div>
            <p>Дэ́ниел Майкл «Дэ́нни» Де Ви́то-мла́дший (англ. Daniel Michael “Danny” DeVito, Jr.; род. 17 ноября 1944, Нептьюн, США) — американский актёр, режиссёр, продюсер. Номинант на премию «Оскар» за фильм «Эрин Брокович».</p>
          </div>
        </div>
       <MyPosts />
      </div>
   )
}

export default Profile;
